import InfoServices from "../../data/InfoServices";
import CardPresentationItem from "../CardPresentationItem/CardPresentationItem";
import classes from "./CardPresentation.module.css";

const CardPresentation = (props) => {
  return (
    <div className={classes.card}>
      <h2>Checkout our services</h2>
      <div className={classes.cardContainer}>
        <div className={classes.cardWrapper}>
          <ul className={classes.cardItems}>
            {InfoServices.map((data) => (
              <CardPresentationItem key={data.id} data={data} />
            ))}
          </ul>
        </div>
      </div>
    </div>
  );
};

export default CardPresentation;
